  {
   "cell_type": "markdown",
   "id": "501ea122-c8a1-41c3-a699-3389894eb9ce",
   "metadata": {},
   "source": [
    "**Summary:**\n",
    "Encoded categorical variables are concatenated with the numeric columns, forming a final dataset ready for model training. Redundant original columns are dropped to prevent duplication.\n"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 9,
   "id": "179270d5-d1da-40be-a677-4e75ea6db44a",
   "metadata": {
    "jupyter": {
     "source_hidden": true
    }
   },
   "outputs": [
    {
     "name": "stdout",
     "output_type": "stream",
     "text": [
      "Shape of the final DataFrame: (9240, 95)\n"
     ]
    }
   ],
   "source": [
    "import pandas as pd\n",
    "from sklearn.impute import SimpleImputer\n",
    "from sklearn.preprocessing import OneHotEncoder\n",
    "\n",
    "# Define categorical and numeric columns\n",
    "categorical_columns = [\n",
    "    'Lead Origin', 'Lead Source', 'Last Activity', 'Specialization',\n",
    "    'What is your current occupation', 'Lead Quality', 'Lead Profile', 'Last Notable Activity'\n",
    "]\n",
    "\n",
    "numeric_columns = [\n",
    "    'TotalVisits', 'Total Time Spent on Website', 'Page Views Per Visit',\n",
    "    'Asymmetrique Activity Index', 'Asymmetrique Profile Index',\n",
    "    'Asymmetrique Activity Score', 'Asymmetrique Profile Score',\n",
    "    'A free copy of Mastering The Interview'\n",
    "]\n",
    "\n",
    "# Check for missing columns\n",
    "missing_categorical = [col for col in categorical_columns if col not in df.columns]\n",
    "missing_numeric = [col for col in numeric_columns if col not in df.columns]\n",
    "\n",
    "if missing_categorical:\n",
    "    print(f\"Warning: Missing categorical columns: {missing_categorical}\")\n",
    "if missing_numeric:\n",
    "    print(f\"Warning: Missing numeric columns: {missing_numeric}\")\n",
    "\n",
    "# Adjust columns lists to exclude missing ones\n",
    "categorical_columns = [col for col in categorical_columns if col in df.columns]\n",
    "numeric_columns = [col for col in numeric_columns if col in df.columns]\n",
    "\n",
    "# Impute missing values for categorical and numeric columns\n",
    "imputer_cat = SimpleImputer(strategy='most_frequent')\n",
    "imputer_num = SimpleImputer(strategy='mean')\n",
    "\n",
    "# Impute categorical columns\n",
    "df[categorical_columns] = imputer_cat.fit_transform(df[categorical_columns])\n",
    "# Impute numeric columns\n",
    "df[numeric_columns] = imputer_num.fit_transform(df[numeric_columns])\n",
    "\n",
    "# One-Hot Encode categorical columns\n",
    "encoder = OneHotEncoder(drop='first', sparse_output=False, handle_unknown='ignore')\n",
    "encoded_cat_array = encoder.fit_transform(df[categorical_columns])\n",
    "encoded_cat_df = pd.DataFrame(encoded_cat_array, columns=encoder.get_feature_names_out(categorical_columns))\n",
    "\n",
    "# Align indices\n",
    "encoded_cat_df.index = df.index\n",
    "\n",
    "# Drop original categorical columns\n",
    "df.drop(columns=[col for col in categorical_columns if col in df.columns], inplace=True)\n",
    "\n",
    "# Combine encoded categorical data with numeric data\n",
    "df_final = pd.concat([df[numeric_columns], encoded_cat_df], axis=1)\n",
    "\n",
    "# Check final DataFrame shape\n",
    "print(f\"Shape of the final DataFrame: {df_final.shape}\")\n",
    "    "
   ]
  },
