    "from flask import Flask, request, jsonify\n",
    "import pandas as pd\n",
    "import joblib\n",
    "import traceback\n",
    "\n",
    "# Load the trained model and features\n",
    "MODEL_PATH = 'rf_top_model.pkl'  # Update with 'rf_refined_model.pkl' if preferred\n",
    "model = joblib.load(MODEL_PATH)\n",
    "print(f\"Model loaded successfully from {MODEL_PATH}\")\n",
    "\n",
    "# Define the Flask app\n",
    "app = Flask(__name__)\n",
    "\n",
    "# Define the list of features expected by the model\n",
    "top_features = [\n",
    "    'Total Time Spent on Website', 'Asymmetrique Activity Score',\n",
    "    'Last Notable Activity_SMS Sent', 'Last Activity_SMS Sent',\n",
    "    'Lead Profile_Potential Lead', 'Page Views Per Visit', 'TotalVisits',\n",
    "    'Lead Profile_Select', 'Lead Origin_Lead Add Form',\n",
    "    'Last Notable Activity_Modified', 'What is your current occupation_Unemployed',\n",
    "    'Lead Quality_Worst', 'Asymmetrique Profile Score',\n",
    "    'What is your current occupation_Working Professional', 'Lead Quality_Not Sure'\n",
    "]\n",
    "\n",
    "@app.route('/predict', methods=['POST'])\n",
    "def predict():\n",
    "    try:\n",
    "        # Parse input JSON\n",
    "        data = request.json\n",
    "        if not data:\n",
    "            return jsonify({\"error\": \"No input data provided\"}), 400\n",
    "\n",
    "        # Convert input data to DataFrame\n",
    "        input_data = pd.DataFrame(data, index=[0])\n",
    "\n",
    "        # Validate required features\n",
    "        missing_features = [feature for feature in top_features if feature not in input_data.columns]\n",
    "        if missing_features:\n",
    "            return jsonify({\"error\": f\"Missing features: {missing_features}\"}), 400\n",
    "\n",
    "        # Ensure input data matches model feature order\n",
    "        input_data = input_data[top_features]\n",
    "\n",
    "        # Make prediction\n",
    "        prediction = model.predict(input_data)\n",
    "        return jsonify({'prediction': int(prediction[0])})\n",
