    "        return jsonify({\n",
    "            \"error\": \"An error occurred during prediction.\",\n",
    "            \"details\": str(e),\n",
    "            \"trace\": traceback.format_exc()\n",
    "        }), 500\n",
    "\n",
    "if __name__ == '__main__':\n",
    "    app.run(debug=False, port=5001)\n"
